import React from 'react';
// import PropTypes from 'prop-types';
import styled from 'styled-components';

const RightMenuStyled = styled.div`
  width: 250px;
`;

const RightMenu = () => {
  return (
    <RightMenuStyled>
      RightMenu
    </RightMenuStyled>
  );
};

RightMenu.propTypes = {
};

export default RightMenu;
